```cpp
#include <iostream>
#include <fstream>
#include <vector>
#include <string>

int countWordOccurrences(const std::string& word, std::vector<std::string>& file) {
    int count = 0;
    int index = 0;

    while ((index = file.get())!= -1) {
        if (std::string(word) == file[index]) {
            count++;
        }
        index++;
    }

    return count;
}

int main() {
    // Path to the text file
    std::string filePath = "path_to_your_file.txt";

    // Specify the word you want to count
    std::string wordToCount = "your_word_here";

    // Create a vector to store word occurrences
    std::vector<std::string> wordOccurrences = new std::vector<std::string>();

    // Open the file for reading
    std::ifstream file(filePath);
    if (!file.is_open()) {
        std::cerr << "Could not open file: " << filePath << std::endl;
        return 1;
    }

    // Read the file line by line
    while (file.is_open()) {
        std::string line;
        file >> line;
        if (!line) {
            continue;
        }

        // Replace newline characters with spaces for word matching
        std::string wordProcessedLine = line.replace('\n','');

        // Find the word in the processed line
        int index = wordOccurrences.find(wordProcessedLine);
        if (index!= wordOccurrences.end()) {
            wordOccurrences[index]++;
        } else {
            wordOccurrences.push_back(wordProcessedLine);
        }
    }

    // Close the file
    file.close();

    // Print the number of occurrences of the word
    std::cout << "The word '" << wordToCount << "' appears " << countWordOccurrences(wordToCount, wordOccurrences) << " times in the file." << std::endl;

    return 0;
}
```

