   - The file is opened in a loop (`while (file.is_open())`).
   - Each line is read line by line and processed:
     - If the line is empty (ends with `\n`), it is skipped.
     - If the line contains the specified word, the line is checked against the vector to see if it already exists. If it does, the occurrence count is incremented. If it doesn't, the line is added to the vector.

4. **Closing the File:**
   - The file is closed after reading.

5. **Output:**
   - The number of occurrences of the specified word is printed.

